INSERT INTO `notices` (`notice_id`, `typdoc`, `tit1`, `tit2`, `tit3`, `tit4`, `tparent_id`, `tnvol`, `ed1_id`, `ed2_id`, `coll_id`, `subcoll_id`, `year`, `nocoll`, `mention_edition`, `code`, `npages`, `ill`, `size`, `accomp`, `n_gen`, `n_contenu`, `n_resume`, `lien`, `eformat`, `index_l`, `indexint`, `index_serie`, `index_matieres`, `niveau_biblio`, `niveau_hierar`, `origine_catalogage`, `prix`, `index_n_gen`, `index_n_contenu`, `index_n_resume`, `index_sew`, `index_wew`, `statut`, `commentaire_gestion`, `create_date`, `update_date`, `signature`, `thumbnail_url`, `date_parution`, `opac_visible_bulletinage`, `indexation_lang`) VALUES (1,'a','Bac en poche','','','',0,'',1,0,1,0,'1997','','','2-211-04459-X','166 p.','couv. ill. en coul.','19 cm','','','La terre est devenue plate comme on se l\'imaginait au Moyen Age et il ne faut pas trop s\'approcher du bord... -- Services Documentaires Multimédia, C\'était, évidemment, une journée magnifique. Une journée pour le Catalogue de la Compagnie. A ce moment là, le bureau de Kin donnait sur un lagon frangé de palmiers. Des rouleaux se brisaient contre les récifs...','','','','',85,'','','m','0',1,'','',' terre est devenue plate comme on se imaginait moyen age il ne faut pas trop s approcher bord services documentaires multimedia c etait evidemment journee magnifique journee pour catalogue compagnie ce moment bureau kin donnait sur lagon frange palmiers rouleaux se brisaient contre recifs ','',' bac poche ','  Bac en poche   ',1,'','2005-01-01 00:00:00','2010-07-30 04:23:43','0','','1997-01-01',1,'');
INSERT INTO `notices` (`notice_id`, `typdoc`, `tit1`, `tit2`, `tit3`, `tit4`, `tparent_id`, `tnvol`, `ed1_id`, `ed2_id`, `coll_id`, `subcoll_id`, `year`, `nocoll`, `mention_edition`, `code`, `npages`, `ill`, `size`, `accomp`, `n_gen`, `n_contenu`, `n_resume`, `lien`, `eformat`, `index_l`, `indexint`, `index_serie`, `index_matieres`, `niveau_biblio`, `niveau_hierar`, `origine_catalogage`, `prix`, `index_n_gen`, `index_n_contenu`, `index_n_resume`, `index_sew`, `index_wew`, `statut`, `commentaire_gestion`, `create_date`, `update_date`, `signature`, `thumbnail_url`, `date_parution`, `opac_visible_bulletinage`, `indexation_lang`) VALUES (2,'a','Catfish blues','','','',0,'',2,0,0,0,'1997','','','2-02-029506-7','154 p.','couv. ill. en coul.','20 cm','','Bibliogr., discogr. des oeuvres de l\'auteur, 2 p.','Catfish Blues, 12 ans, n\'a qu\'une idée en tête: fuir la plantation de coton où travaillent ses frères et soeurs et suivre son oncle Eddie pour devenir chanteur de blues à Chicago. Chronique de la vie d\'un petit Noir aux prises avec les escrocs de tout poil, y compris le Ku Klux Klan, ce roman vaut aussi par la vivacité de son écriture. Un beau portrait d\'époque. --Laurence Liban, ©Lire','','','','coton;blues;musique;racisme',0,'',' coton blues musique racisme ','m','0',1,'',' bibliogr discogr oeuvres auteur 2 p ',' catfish blues 12 ans n qu idee tete fuir plantation coton ou travaillent ses freres soeurs suivre son oncle eddie pour devenir chanteur blues chicago chronique vie petit noir prises avec escrocs tout poil y compris ku klux klan ce roman vaut aussi par vivacite son ecriture beau portrait epoque laurence liban lire ','',' catfish blues ','  Catfish blues   ',1,'','2005-01-01 00:00:00','2010-07-30 04:23:43','0','','1997-01-01',1,'');
INSERT INTO `notices` (`notice_id`, `typdoc`, `tit1`, `tit2`, `tit3`, `tit4`, `tparent_id`, `tnvol`, `ed1_id`, `ed2_id`, `coll_id`, `subcoll_id`, `year`, `nocoll`, `mention_edition`, `code`, `npages`, `ill`, `size`, `accomp`, `n_gen`, `n_contenu`, `n_resume`, `lien`, `eformat`, `index_l`, `indexint`, `index_serie`, `index_matieres`, `niveau_biblio`, `niveau_hierar`, `origine_catalogage`, `prix`, `index_n_gen`, `index_n_contenu`, `index_n_resume`, `index_sew`, `index_wew`, `statut`, `commentaire_gestion`, `create_date`, `update_date`, `signature`, `thumbnail_url`, `date_parution`, `opac_visible_bulletinage`, `indexation_lang`) VALUES (3,'a','Trois fêlés et un pendu','','','',0,'',3,0,0,0,'1998','','','2-84146-554-3','29 p.','couv. ill. en coul.','18 cm','','','Lucien a trouvé un trésor dans une grange abandonnée. Lorsqu\'il y retourne avec ses copains, un homme est pendu au centre du bâtiment. Subterfuge pour les faire fuir, le pendu n\'est pas mort et le trésor est sien. Grâce à Dédé qui s\'est sauvé chercher du secours, le criminel est écroué. -- Services Documentaires Multimédia','','','','copains;policier',81,'',' copains policier ','m','0',1,'','',' lucien trouve tresor dans grange abandonnee lorsqu il y retourne avec ses copains homme est pendu centre batiment subterfuge pour faire fuir pendu n est pas mort tresor est sien grace dede qui s est sauve chercher secours criminel est ecroue services documentaires multimedia ','',' trois feles pendu ','  Trois fêlés et un pendu   ',1,'','2005-01-01 00:00:00','2010-07-30 04:23:43','0','','1998-01-01',1,'');
INSERT INTO `notices` (`notice_id`, `typdoc`, `tit1`, `tit2`, `tit3`, `tit4`, `tparent_id`, `tnvol`, `ed1_id`, `ed2_id`, `coll_id`, `subcoll_id`, `year`, `nocoll`, `mention_edition`, `code`, `npages`, `ill`, `size`, `accomp`, `n_gen`, `n_contenu`, `n_resume`, `lien`, `eformat`, `index_l`, `indexint`, `index_serie`, `index_matieres`, `niveau_biblio`, `niveau_hierar`, `origine_catalogage`, `prix`, `index_n_gen`, `index_n_contenu`, `index_n_resume`, `index_sew`, `index_wew`, `statut`, `commentaire_gestion`, `create_date`, `update_date`, `signature`, `thumbnail_url`, `date_parution`, `opac_visible_bulletinage`, `indexation_lang`) VALUES (4,'a','Le dieu devenu homme','','','',0,'',4,0,0,0,'1998','','','2-86274-547-2','125 p.','','21 cm','','Recueil de nouvelles','','Quatorze nouvelles dont l\'intrigue, ayant un personnage célèbre comme actant, se déroule entre 1820 et 1867. On doit ajouter pour l\'intérêt du lecteur que quelques-uns des personnages se nomment Hugo, Lamartine, Vigny, Musset, Balzac... -- Services Documentaires Multimédia','','','roman historique,fiction;nouvelle;nouvelles',85,'',' roman historique fiction nouvelle nouvelles ','m','0',1,'',' recueil nouvelles ','',' quatorze nouvelles dont intrigue ayant personnage celebre comme actant se deroule entre 1820 1867 on doit ajouter pour interet lecteur que quelques uns personnages se nomment hugo lamartine vigny musset balzac services documentaires multimedia ',' dieu devenu homme ','  Le dieu devenu homme   ',1,'','2005-01-01 00:00:00','2010-07-30 04:23:43','0','','1998-01-01',1,'');
