INSERT INTO `notices` (`notice_id`, `typdoc`, `tit1`, `tit2`, `tit3`, `tit4`, `tparent_id`, `tnvol`, `ed1_id`, `ed2_id`, `coll_id`, `subcoll_id`, `year`, `nocoll`, `mention_edition`, `code`, `npages`, `ill`, `size`, `accomp`, `n_gen`, `n_contenu`, `n_resume`, `lien`, `eformat`, `index_l`, `indexint`, `index_serie`, `index_matieres`, `niveau_biblio`, `niveau_hierar`, `origine_catalogage`, `prix`, `index_n_gen`, `index_n_contenu`, `index_n_resume`, `index_sew`, `index_wew`, `statut`, `commentaire_gestion`, `create_date`, `update_date`, `signature`, `thumbnail_url`, `date_parution`, `opac_visible_bulletinage`, `indexation_lang`) VALUES (8,'a','Ghetto 9','','','',0,'1',7,0,8,0,'1993','','','2-7234-1542-2','47 p.','ill. en coul., couv. ill. en coul.','33 cm','','','','Dans une Afrique futuriste, un consortium exploite à outrance les ressources du continent. Et quand Dayak découvre que l\'homme qui dirige cet empire technologique n\'est autre que son propre frère, la lutte prend une dimension fascinante. Dayak possède l\'énergie et la force des meilleures sagas de S.F. et confirme le talent visionnaire du dessin d\'Adamov, qui signe là son premier scénario.','','','',77,'','','m','0',1,'','','',' dans afrique futuriste consortium exploite outrance ressources continent quand dayak decouvre que homme qui dirige cet empire technologique n est autre que son propre frere lutte prend dimension fascinante dayak possede energie force meilleures sagas s f confirme talent visionnaire dessin adamov qui signe son premier scenario ',' 1 ghetto 9 ',' 1 Ghetto 9   ',1,'','2005-01-01 00:00:00','2010-09-21 13:55:07','0','','1993-01-01',1,'');
INSERT INTO `notices` (`notice_id`, `typdoc`, `tit1`, `tit2`, `tit3`, `tit4`, `tparent_id`, `tnvol`, `ed1_id`, `ed2_id`, `coll_id`, `subcoll_id`, `year`, `nocoll`, `mention_edition`, `code`, `npages`, `ill`, `size`, `accomp`, `n_gen`, `n_contenu`, `n_resume`, `lien`, `eformat`, `index_l`, `indexint`, `index_serie`, `index_matieres`, `niveau_biblio`, `niveau_hierar`, `origine_catalogage`, `prix`, `index_n_gen`, `index_n_contenu`, `index_n_resume`, `index_sew`, `index_wew`, `statut`, `commentaire_gestion`, `create_date`, `update_date`, `signature`, `thumbnail_url`, `date_parution`, `opac_visible_bulletinage`, `indexation_lang`) VALUES (9,'a','Zaks','','','',0,'3',7,0,8,0,'1997','','','2-7234-2083-3','47 p.','ill. en coul., couv. ill. en coul.','32 cm','','','','Une fois la ville-mère détruite, implosée, Dayak a réussi à échapper aux intercepteurs.En compagnie de son fidèle P\'tit Caille, le voilà au coeur du désert, prêt à se fondre dans cet univers inhospitalier, mais toujours suivi, à quelque distance, par son frère Simon, plus que jamais décidé à le rattraper. Or le Grand Désert est aussi le domaine des Zaks, les hommes-masques aux yeux sanguins. N\'est-ce qu\'un peuple de légende, où sont-ils vraiment là, cachés dans un dédale de galeries souterraines labyrinthiques ?Dayak ne tardera pas à être fixé . Bientôt résonneront les tambours des traditions humaines les plus anciennes, et les ombres démesurées des silhouettes primitives viendront s\'allonger auprès de lui.Grâce à leur intervention, Dayak parviendra à triompher définitivement de son frère, si tant est que la mort, pour les gens de son espèce, soit vraiment une fin...Alors, qui sont au juste ces Zaks qui s\'expriment en ces lieux désertiques ?Et si Dayak, d\'une certaine façon, finissait par devenir l\'un des leurs ?...','','','',77,'','','m','0',1,'','','',' fois ville mere detruite implosee dayak reussi echapper intercepteurs compagnie son fidele p tit caille voila coeur desert pret se fondre dans cet univers inhospitalier mais toujours suivi quelque distance par son frere simon plus que jamais decide rattraper or grand desert est aussi domaine zaks hommes masques yeux sanguins n est ce qu peuple legende ou sont ils vraiment caches dans dedale galeries souterraines labyrinthiques dayak ne tardera pas etre fixe bientot resonneront tambours traditions humaines plus anciennes ombres demesurees silhouettes primitives viendront s allonger aupres lui grace leur intervention dayak parviendra triompher definitivement son frere si tant est que mort pour gens son espece soit vraiment fin alors qui sont juste ces zaks qui s expriment ces lieux desertiques si dayak certaine facon finissait par devenir leurs ',' 3 zaks ',' 3 Zaks   ',1,'','2005-01-01 00:00:00','2010-09-21 13:55:07','0','','1997-01-01',1,'');
INSERT INTO `notices` (`notice_id`, `typdoc`, `tit1`, `tit2`, `tit3`, `tit4`, `tparent_id`, `tnvol`, `ed1_id`, `ed2_id`, `coll_id`, `subcoll_id`, `year`, `nocoll`, `mention_edition`, `code`, `npages`, `ill`, `size`, `accomp`, `n_gen`, `n_contenu`, `n_resume`, `lien`, `eformat`, `index_l`, `indexint`, `index_serie`, `index_matieres`, `niveau_biblio`, `niveau_hierar`, `origine_catalogage`, `prix`, `index_n_gen`, `index_n_contenu`, `index_n_resume`, `index_sew`, `index_wew`, `statut`, `commentaire_gestion`, `create_date`, `update_date`, `signature`, `thumbnail_url`, `date_parution`, `opac_visible_bulletinage`, `indexation_lang`) VALUES (10,'a','La chambre verte','','','',0,'2',7,0,8,0,'1994','','','2-7234-1727-1','47 p.','ill. en coul., couv. ill. en coul.','32 cm','','','','La nouvelle Addis Abeba est née !Fini le ghetto, sa misère et sa crasse... Simon Colbius, leader de la C.P.M., a fait surgir une mégalopole où les techniques les plus sophistiquées côtoient les traditions les plus anciennes.Un monde où P\'tit Caille est devenu le valet de chambre du nouveau despote et Cori une courtisane que le nouveau comportement de Dayak trouble à peine.Car Dayak sait maintenant qu\'il est le frère de Simon, il a retrouvé dans de lointains souvenirs la vision fugace de cette Chambre verte où, enfants, ils percevaient les formidables changements que leur père orchestrait.Devenu le clone de Simon, Dayak parviendra-t-il à briser les chaînes qui le relient à ce frère qui se rêve maître de l\'Afrique et empereur d\'un nouvel âge ?','','','',77,'','','m','0',1,'','','',' nouvelle addis abeba est nee fini ghetto sa misere sa crasse simon colbius leader c p m fait surgir megalopole ou techniques plus sophistiquees cotoient traditions plus anciennes monde ou p tit caille est devenu valet chambre nouveau despote cori courtisane que nouveau comportement dayak trouble peine car dayak sait maintenant qu il est frere simon il retrouve dans lointains souvenirs vision fugace cette chambre verte ou enfants ils percevaient formidables changements que leur pere orchestrait devenu clone simon dayak parviendra il briser chaines qui relient ce frere qui se reve maitre afrique empereur nouvel age ',' 2 chambre verte ',' 2 La chambre verte   ',1,'','2005-01-01 00:00:00','2010-09-21 13:55:07','0','','1994-01-01',1,'');
INSERT INTO `notices` (`notice_id`, `typdoc`, `tit1`, `tit2`, `tit3`, `tit4`, `tparent_id`, `tnvol`, `ed1_id`, `ed2_id`, `coll_id`, `subcoll_id`, `year`, `nocoll`, `mention_edition`, `code`, `npages`, `ill`, `size`, `accomp`, `n_gen`, `n_contenu`, `n_resume`, `lien`, `eformat`, `index_l`, `indexint`, `index_serie`, `index_matieres`, `niveau_biblio`, `niveau_hierar`, `origine_catalogage`, `prix`, `index_n_gen`, `index_n_contenu`, `index_n_resume`, `index_sew`, `index_wew`, `statut`, `commentaire_gestion`, `create_date`, `update_date`, `signature`, `thumbnail_url`, `date_parution`, `opac_visible_bulletinage`, `indexation_lang`) VALUES (11,'a','Le chirurgien hollandais','','','',0,'',7,0,0,0,'1996','','','2-7234-2062-0','47 p.','ill. en coul., couv. ill. en coul.','32 cm','','','','Ile de Java, région de Semarang en 1897. Un décor exotique pour une aventure riche en rebondissements. Ironie et drame se conjugent pour ce premier tome d\'une nouvelle série qui confirme le talent de Christian Lamquet.\r\nUn chirurgien hollandais a découvert un crâne qu\'il cherche à faire authentifier comme l\'un des chaînons manquant de l\'histoire de l\'homme. Autour de lui, des personnages haut en couleurs : savants baroques, veuve éplorée, la guenon Lucy, un journaliste zélé, une femme qui ne rêve que de maternité. Et enfin : Pete, le crâne, lui-même personnage central de ce récit utilisant habilement théosophie, un mélange d\'occultisme et de spiritisme, et anthropologie.\r\nParce qu\'il est convaincu d\'avoir mis à jour des fossiles du fameux \"chaînon manquant\", Jacob Boos, un chirurgien hollandais en garnison à Semarang, est bien décidé à remuer ciel, terre, océan et bonne conscience pour prouver au monde la réalité de sa découverte...\r\n\" Pete \" comme il le surnomme affectueusement, était-il vraiment ce petit \"homme-singe debout\" parcourant la savane voici deux millions d\'années ?\r\nPour l\'heure, ce qu\'il a laissé de lui sommeille dans une valise : quelques bouts de vertèbres, un crâne, un morceau de mâchoire. Si Jacob y investit tous ses espoirs, d\'autres vont y engluer les précieuses reliques dans les délires de leurs utopies, de leurs passions ou de leur bêtises...\r\n Et puis tous ces malheurs qui se succèdent...\r\nPete, du fond de sa valise, porterait-il la poisse ?  ','','','bande dessinée',77,'',' bande dessinee ','m','0',1,'','','',' ile java region semarang 1897 decor exotique pour aventure riche rebondissements ironie drame se conjugent pour ce premier tome nouvelle serie qui confirme talent christian lamquet chirurgien hollandais decouvert crane qu il cherche faire authentifier comme chainons manquant histoire homme autour lui personnages haut couleurs savants baroques veuve eploree guenon lucy journaliste zele femme qui ne reve que maternite enfin pete crane lui meme personnage central ce recit utilisant habilement theosophie melange occultisme spiritisme anthropologie parce qu il est convaincu avoir mis jour fossiles fameux chainon manquant jacob boos chirurgien hollandais garnison semarang est bien decide remuer ciel terre ocean bonne conscience pour prouver monde realite sa decouverte pete comme il surnomme affectueusement etait il vraiment ce petit homme singe debout parcourant savane voici deux millions annees pour heure ce qu il laisse lui sommeille dans valise quelques bouts vertebres crane morceau machoire si jacob y investit tous ses espoirs autres vont y engluer precieuses reliques dans delires leurs utopies leurs passions ou leur betises puis tous ces malheurs qui se succedent pete fond sa valise porterait il poisse ',' chirurgien hollandais ','  Le chirurgien hollandais   ',1,'','2005-01-01 00:00:00','2010-09-21 13:55:07','0','','1996-01-01',1,'');
INSERT INTO `notices` (`notice_id`, `typdoc`, `tit1`, `tit2`, `tit3`, `tit4`, `tparent_id`, `tnvol`, `ed1_id`, `ed2_id`, `coll_id`, `subcoll_id`, `year`, `nocoll`, `mention_edition`, `code`, `npages`, `ill`, `size`, `accomp`, `n_gen`, `n_contenu`, `n_resume`, `lien`, `eformat`, `index_l`, `indexint`, `index_serie`, `index_matieres`, `niveau_biblio`, `niveau_hierar`, `origine_catalogage`, `prix`, `index_n_gen`, `index_n_contenu`, `index_n_resume`, `index_sew`, `index_wew`, `statut`, `commentaire_gestion`, `create_date`, `update_date`, `signature`, `thumbnail_url`, `date_parution`, `opac_visible_bulletinage`, `indexation_lang`) VALUES (12,'a','La Chrysalide Diaprée','','','',0,'',8,0,0,0,'1997','','','2-86967-551-8','Cartonné - 48 pages','','23 x 32','','','','Pour sauver son grand-père qui se meurt, Benjamin doit ramener le Mangecoeur, un papillon funeste, avant l\'aube. Poursuivi par des clowns cruels dans une fête foraine où seuls les adultes sont admis, il rencontre Rififi, seul allié dans sa fuite. Mais cet ami et son compagnon Pantagas utilisent Benjamin à des fins peu louables... Le rêve et la magie règnent en maîtres dans ce conte merveilleux peuplé de clowns dangereusement malicieux. Le trait brillant de Jean-Baptiste Andréae s\'associe au scénario plus qu\'efficace de Mathieu Gallié.  ','','','bande dessinée',0,'',' bande dessinee ','m','0',1,'EUR 11,40','','',' pour sauver son grand pere qui se meurt benjamin doit ramener mangecoeur papillon funeste avant aube poursuivi par clowns cruels dans fete foraine ou seuls adultes sont admis il rencontre rififi seul allie dans sa fuite mais cet ami son compagnon pantagas utilisent benjamin fins peu louables reve magie regnent maitres dans ce conte merveilleux peuple clowns dangereusement malicieux trait brillant jean baptiste andreae s associe scenario plus qu efficace mathieu gallie ',' chrysalide diapree ','  La Chrysalide Diaprée   ',1,'','2005-01-01 00:00:00','2010-09-21 13:55:07','0','','1997-01-01',1,'');
