INSERT INTO `notices` (`notice_id`, `typdoc`, `tit1`, `tit2`, `tit3`, `tit4`, `tparent_id`, `tnvol`, `ed1_id`, `ed2_id`, `coll_id`, `subcoll_id`, `year`, `nocoll`, `mention_edition`, `code`, `npages`, `ill`, `size`, `accomp`, `n_gen`, `n_contenu`, `n_resume`, `lien`, `eformat`, `index_l`, `indexint`, `index_serie`, `index_matieres`, `niveau_biblio`, `niveau_hierar`, `origine_catalogage`, `prix`, `index_n_gen`, `index_n_contenu`, `index_n_resume`, `index_sew`, `index_wew`, `statut`, `commentaire_gestion`, `create_date`, `update_date`, `signature`, `thumbnail_url`, `date_parution`, `opac_visible_bulletinage`, `indexation_lang`) VALUES (15,'a','La métamorphose des fleurs','','','',0,'',11,0,0,0,'1997','','','2-7324-2351-3','143 p. dont 4 dépl.','ill. en coul., jaquette ill. en coul.','30 cm','','','','Avec Microcosmos, des milliers de lecteurs se sont émerveillés devant les prodiges insoupçonnés d\'un petit carré d\'herbes folles. Dans la Métamorphose des Fleurs, Claude Nuridsany et Marie Pérennou sillonnent prairies et jardins et invitent nos yeux inattentifs à se poser sur un bouton gorgé de sève, un pétale qui s\'entrouvre ou la chute d\'une corolle. Autant de moments phares de la vie flamboyante d\'une fleur, architecture de rêve construite et défaite en quelques jours. Transfigurées par la magie de la macrophotographie, une vingtaine d\'espèces florales naissent, vivent et meurent sous nos yeux. Marie Pérennou et Claude Nuridsany ont inventé, pour notre plus grand plaisir, un nouveau regard sur la nature, à mi-chemin entre la biologie et la poésie.','','','fleur;pistil;étamine;macrophotographie',59,'',' fleur pistil etamine macrophotographie ','m','0',1,'','','',' avec microcosmos milliers lecteurs se sont emerveilles devant prodiges insoupconnes petit carre herbes folles dans metamorphose fleurs claude nuridsany marie perennou sillonnent prairies jardins invitent nos yeux inattentifs se poser sur bouton gorge seve petale qui s entrouvre ou chute corolle autant moments phares vie flamboyante fleur architecture reve construite defaite quelques jours transfigurees par magie macrophotographie vingtaine especes florales naissent vivent meurent sous nos yeux marie perennou claude nuridsany ont invente pour notre plus grand plaisir nouveau regard sur nature mi chemin entre biologie poesie ',' metamorphose fleurs ','  La métamorphose des fleurs   ',1,'','2005-01-01 00:00:00','2010-07-30 04:23:43','0','','1997-01-01',1,'');
