le guillaume rezay paroisse ceaux maine loire vend messire vernee chevalier sept sous six deniers rente acte passe cour angers jeudi avant saint urbain an mille deux cent quatre vingt dix neuf ','  Charte du XIIIe siècle, par laquelle Guillaume de Rezay de la paroisse de Ceaux (Maine et Loire) vend à Messire de Vernée, chevalier, sept sous et six deniers de rente.   Acte passé en la cour d\'Angers le jeudi avant la Saint Urbain l\'an mille deux cent quatre vingt dix neuf.',1,'','2005-01-01 00:00:00','2010-07-30 04:23:42','0','','0000-00-00',1,'');
