INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (4,14,0,0,'Quatorze nouvelles dont l\'intrigue, ayant un personnage célèbre comme actant, se déroule entre 1820 et 1867. On doit ajouter pour l\'intérêt du lecteur que quelques-uns des personnages se nomment Hugo, Lamartine, Vigny, Musset, Balzac... -- Services Documentaires Multimédia',100,'');
INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (6,4,0,0,'roman',130,'');
INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (7,14,0,0,'La sécheresse a tari tous les puits de la région. Tous sauf celui des Logan, famille de fermiers noirs aisée. Les Logan partagent cette eau précieuse de grand cœur, avec tous. Mais en 1910, dans le Sud américain, les rancœurs contre les Noirs sont tenaces... Tout au long de l\'été, la tension monte, aussi accablante que la chaleur.',100,'');
INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (8,14,0,0,'Dans une Afrique futuriste, un consortium exploite à outrance les ressources du continent. Et quand Dayak découvre que l\'homme qui dirige cet empire technologique n\'est autre que son propre frère, la lutte prend une dimension fascinante. Dayak possède l\'énergie et la force des meilleures sagas de S.F. et confirme le talent visionnaire du dessin d\'Adamov, qui signe là son premier scénario.',100,'');
INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (9,14,0,0,'Une fois la ville-mère détruite, implosée, Dayak a réussi à échapper aux intercepteurs.En compagnie de son fidèle P\'tit Caille, le voilà au coeur du désert, prêt à se fondre dans cet univers inhospitalier, mais toujours suivi, à quelque distance, par son frère Simon, plus que jamais décidé à le rattraper. Or le Grand Désert est aussi le domaine des Zaks, les hommes-masques aux yeux sanguins. N\'est-ce qu\'un peuple de légende, où sont-ils vraiment là, cachés dans un dédale de galeries souterraines labyrinthiques ?Dayak ne tardera pas à être fixé . Bientôt résonneront les tambours des traditions humaines les plus anciennes, et les ombres démesurées des silhouettes primitives viendront s\'allonger auprès de lui.Grâce à leur intervention, Dayak parviendra à triompher définitivement de son frère, si tant est que la mort, pour les gens de son espèce, soit vraiment une fin...Alors, qui sont au juste ces Zaks qui s\'expriment en ces lieux désertiques ?Et si Dayak, d\'une certaine façon, finissait par devenir l\'un des leurs ?...',100,'');
INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (10,14,0,0,'La nouvelle Addis Abeba est née !Fini le ghetto, sa misère et sa crasse... Simon Colbius, leader de la C.P.M., a fait surgir une mégalopole où les techniques les plus sophistiquées côtoient les traditions les plus anciennes.Un monde où P\'tit Caille est devenu le valet de chambre du nouveau despote et Cori une courtisane que le nouveau comportement de Dayak trouble à peine.Car Dayak sait maintenant qu\'il est le frère de Simon, il a retrouvé dans de lointains souvenirs la vision fugace de cette Chambre verte où, enfants, ils percevaient les formidables changements que leur père orchestrait.Devenu le clone de Simon, Dayak parviendra-t-il à briser les chaînes qui le relient à ce frère qui se rêve maître de l\'Afrique et empereur d\'un nouvel âge ?',100,'');
INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (11,14,0,0,'Ile de Java, région de Semarang en 1897. Un décor exotique pour une aventure riche en rebondissements. Ironie et drame se conjugent pour ce premier tome d\'une nouvelle série qui confirme le talent de Christian Lamquet.\r\nUn chirurgien hollandais a découvert un crâne qu\'il cherche à faire authentifier comme l\'un des chaînons manquant de l\'histoire de l\'homme. Autour de lui, des personnages haut en couleurs : savants baroques, veuve éplorée, la guenon Lucy, un journaliste zélé, une femme qui ne rêve que de maternité. Et enfin : Pete, le crâne, lui-même personnage central de ce récit utilisant habilement théosophie, un mélange d\'occultisme et de spiritisme, et anthropologie.\r\nParce qu\'il est convaincu d\'avoir mis à jour des fossiles du fameux \"chaînon manquant\", Jacob Boos, un chirurgien hollandais en garnison à Semarang, est bien décidé à remuer ciel, terre, océan et bonne conscience pour prouver au monde la réalité de sa découverte...\r\n\" Pete \" comme il le surnomme affectueusement, était-il vraiment ce petit \"homme-singe debout\" parcourant la savane voici deux millions d\'années ?\r\nPour l\'heure, ce qu\'il a laissé de lui sommeille dans une valise : quelques bouts de vertèbres, un crâne, un morceau de mâchoire. Si Jacob y investit tous ses espoirs, d\'autres vont y engluer les précieuses reliques dans les délires de leurs utopies, de leurs passions ou de leur bêtises...\r\n Et puis tous ces malheurs qui se succèdent...\r\nPete, du fond de sa valise, porterait-il la poisse ?',100,'');
INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (12,14,0,0,'Pour sauver son grand-père qui se meurt, Benjamin doit ramener le Mangecoeur, un papillon funeste, avant l\'aube. Poursuivi par des clowns cruels dans une fête foraine où seuls les adultes sont admis, il rencontre Rififi, seul allié dans sa fuite. Mais cet ami et son compagnon Pantagas utilisent Benjamin à des fins peu louables... Le rêve et la magie règnent en maîtres dans ce conte merveilleux peuplé de clowns dangereusement malicieux. Le trait brillant de Jean-Baptiste Andréae s\'associe au scénario plus qu\'efficace de Mathieu Gallié.',100,'');
INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (15,14,0,0,'Avec Microcosmos, des milliers de lecteurs se sont émerveillés devant les prodiges insoupçonnés d\'un petit carré d\'herbes folles. Dans la Métamorphose des Fleurs, Claude Nuridsany et Marie Pérennou sillonnent prairies et jardins et invitent nos yeux inattentifs à se poser sur un bouton gorgé de sève, un pétale qui s\'entrouvre ou la chute d\'une corolle. Autant de moments phares de la vie flamboyante d\'une fleur, architecture de rêve construite et défaite en quelques jours. Transfigurées par la magie de la macrophotographie, une vingtaine d\'espèces florales naissent, vivent et meurent sous nos yeux. Marie Pérennou et Claude Nuridsany ont inventé, pour notre plus grand plaisir, un nouveau regard sur la nature, à mi-chemin entre la biologie et la poésie.',100,'');
