INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (1,13,0,0,'La terre est devenue plate comme on se l\'imaginait au Moyen Age et il ne faut pas trop s\'approcher du bord... -- Services Documentaires Multimédia, C\'était, évidemment, une journée magnifique. Une journée pour le Catalogue de la Compagnie. A ce moment là, le bureau de Kin donnait sur un lagon frangé de palmiers. Des rouleaux se brisaient contre les récifs...',120,'');
