INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (2,13,0,0,'Catfish Blues, 12 ans, n\'a qu\'une idée en tête: fuir la plantation de coton où travaillent ses frères et soeurs et suivre son oncle Eddie pour devenir chanteur de blues à Chicago. Chronique de la vie d\'un petit Noir aux prises avec les escrocs de tout poil, y compris le Ku Klux Klan, ce roman vaut aussi par la vivacité de son écriture. Un beau portrait d\'époque. --Laurence Liban, ©Lire',120,'');
