INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (3,13,0,0,'Lucien a trouvé un trésor dans une grange abandonnée. Lorsqu\'il y retourne avec ses copains, un homme est pendu au centre du bâtiment. Subterfuge pour les faire fuir, le pendu n\'est pas mort et le trésor est sien. Grâce à Dédé qui s\'est sauvé chercher du secours, le criminel est écroué. -- Services Documentaires Multimédia',120,'');
