INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (5,13,0,0,'A défaut de fils, un vieux savant mal en point fait de sa fille aînée son disciple. La grande bibliothèque de Cordoue est interdite aux femmes. Pour accomplir les voeux de son père Sarah accepte de se travestir, de devenir Samuel. Elle reçoit un poème galant d\'un jeune étudiant musulman. Qui, de Samuel ou de Sarah aime-t-il? Une belle histoire d\'amour avec, en toile de fond, une fresque de Cordoue du 12e siècle. -- Services Documentaires Multimédia',120,'');
