INSERT INTO `notices_fields_global_index` (`id_notice`, `code_champ`, `code_ss_champ`, `ordre`, `value`, `pond`, `lang`) VALUES (17,13,0,0,'Présentation de l\'éditeur\r\nLa nouvelle génération des cartes routières Michelin ! Toutes les informations pour découvrir, sur une seule carte, un, deux ou trois départements de France et se repérer facilement en voiture.\r\n\r\nDe nombreuses nouveautés ont été intégrées à la carte « LOCAL » :\r\n- une carte plus lisible grâce à une échelle agrandie : 1/150 000e ou 1/175 000e\r\n- un index complet des localités pour accéder rapidement à l\'information\r\n- des plans de ville pour circuler dans les grandes agglomérations\r\n- une légende en image pour bien comprendre les symboles de la carte\r\n- une carte des terroirs\r\nUne nouvelle collection de cartes centrées sur le \"LOCAL\" pour vivre la route autrement !\r\npixel',120,'');
