INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (1,1,'    Bac en poche      La terre est devenue plate comme on se l\'imaginait au Moyen Age et il ne faut pas trop s\'approcher du bord... -- Services Documentaires Multimédia, C\'était, évidemment, une journée magnifique. Une journée pour le Catalogue de la Compagnie. A ce moment là, le bureau de Kin donnait sur un lagon frangé de palmiers. Des rouleaux se brisaient contre les récifs...  Souton Dominique      Roman d\'aventure 840 Littérature française Médium  L\'École des loisirs ','   bac poche     terre est devenue plate comme on se imaginait moyen age il ne faut pas trop s approcher bord services documentaires multimedia c etait evidemment journee magnifique journee pour catalogue compagnie ce moment bureau kin donnait sur lagon frange palmiers rouleaux se brisaient contre recifs   souton dominique roman aventure 840 litterature francaise medium  l ecole des loisirs ');
INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (2,1,'    Catfish blues     Bibliogr., discogr. des oeuvres de l\'auteur, 2 p. Catfish Blues, 12 ans, n\'a qu\'une idée en tête: fuir la plantation de coton où travaillent ses frères et soeurs et suivre son oncle Eddie pour devenir chanteur de blues à Chicago. Chronique de la vie d\'un petit Noir aux prises avec les escrocs de tout poil, y compris le Ku Klux Klan, ce roman vaut aussi par la vivacité de son écriture. Un beau portrait d\'époque. --Laurence Liban, ©Lire coton;blues;musique;racisme Herzhaft Gérard      Littérature française Seuil ','   catfish blues    bibliogr discogr oeuvres auteur 2 p   catfish blues 12 ans n qu idee tete fuir plantation coton ou travaillent ses freres soeurs suivre son oncle eddie pour devenir chanteur blues chicago chronique vie petit noir prises avec escrocs tout poil y compris ku klux klan ce roman vaut aussi par vivacite son ecriture beau portrait epoque laurence liban lire   coton blues musique racisme  herzhaft gerard litterature francaise seuil ');
INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (3,1,'    Trois fêlés et un pendu      Lucien a trouvé un trésor dans une grange abandonnée. Lorsqu\'il y retourne avec ses copains, un homme est pendu au centre du bâtiment. Subterfuge pour les faire fuir, le pendu n\'est pas mort et le trésor est sien. Grâce à Dédé qui s\'est sauvé chercher du secours, le criminel est écroué. -- Services Documentaires Multimédia copains;policier Oppel Jean-Hugues      Littérature française 800 Littérature Syros jeunesse ','   trois feles pendu     lucien trouve tresor dans grange abandonnee lorsqu il y retourne avec ses copains homme est pendu centre batiment subterfuge pour faire fuir pendu n est pas mort tresor est sien grace dede qui s est sauve chercher secours criminel est ecroue services documentaires multimedia   copains policier  oppel jean hugues litterature francaise 800 litterature syros jeunesse ');
INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (4,1,'    Le dieu devenu homme    Quatorze nouvelles dont l\'intrigue, ayant un personnage célèbre comme actant, se déroule entre 1820 et 1867. On doit ajouter pour l\'intérêt du lecteur que quelques-uns des personnages se nomment Hugo, Lamartine, Vigny, Musset, Balzac... -- Services Documentaires Multimédia Recueil de nouvelles  roman historique,fiction;nouvelle;nouvelles Zimmermann Daniel      Nouvelles 840 Littérature française le Cherche-Midi éd. ','   dieu devenu homme   quatorze nouvelles dont intrigue ayant personnage celebre comme actant se deroule entre 1820 1867 on doit ajouter pour interet lecteur que quelques uns personnages se nomment hugo lamartine vigny musset balzac services documentaires multimedia   recueil nouvelles    roman historique fiction nouvelle nouvelles  zimmermann daniel nouvelles 840 litterature francaise le cherche midi ed ');
INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (5,1,'    Sarah de Cordoue      A défaut de fils, un vieux savant mal en point fait de sa fille aînée son disciple. La grande bibliothèque de Cordoue est interdite aux femmes. Pour accomplir les voeux de son père Sarah accepte de se travestir, de devenir Samuel. Elle reçoit un poème galant d\'un jeune étudiant musulman. Qui, de Samuel ou de Sarah aime-t-il? Une belle histoire d\'amour avec, en toile de fond, une fresque de Cordoue du 12e siècle. -- Services Documentaires Multimédia  Causse Rolande      Espagne 840 Littérature française Les |uns, les autres  Syros jeunesse ','   sarah cordoue     defaut fils vieux savant mal point fait sa fille ainee son disciple grande bibliotheque cordoue est interdite femmes pour accomplir voeux son pere sarah accepte se travestir devenir samuel elle recoit poeme galant jeune etudiant musulman qui samuel ou sarah aime il belle histoire amour avec toile fond fresque cordoue 12e siecle services documentaires multimedia   causse rolande espagne 840 litterature francaise uns autres  syros jeunesse ');
INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (6,1,'    Le mille-pattes   roman   Le titre crypté désigne les onze joueurs de l\'équipe de France de football impliqués en ce récit dans une intrigue \"alternative\" par rapport à l\'événement de 1998. -- Services Documentaires Multimédia bleus;champions du monde;1998;policier;ballon rond Riou Jean-Michel      Littérature française Football Denoël ','   mille pattes roman     titre crypte designe onze joueurs equipe france football impliques ce recit dans intrigue alternative par rapport evenement 1998 services documentaires multimedia   bleus champions monde 1998 policier ballon rond  riou jean michel litterature francaise football denoel ');
INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (7,1,'    Le puits    La sécheresse a tari tous les puits de la région. Tous sauf celui des Logan, famille de fermiers noirs aisée. Les Logan partagent cette eau précieuse de grand cœur, avec tous. Mais en 1910, dans le Sud américain, les rancœurs contre les Noirs sont tenaces... Tout au long de l\'été, la tension monte, aussi accablante que la chaleur.   coton;policier Vassallo-Villaneau Rose-Marie      Taylor Mildred D.      Littérature américaine 810 Littérature américaine Flammarion ','   puits   secheresse tari tous puits region tous sauf celui logan famille fermiers noirs aisee logan partagent cette eau precieuse grand c ur avec tous mais 1910 dans sud americain ranc urs contre noirs sont tenaces tout long ete tension monte aussi accablante que chaleur     coton policier  vassallo villaneau rose marie taylor mildred d litterature americaine 810 litterature americaine flammarion ');
INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (8,1,' 1  1 Ghetto 9    Dans une Afrique futuriste, un consortium exploite à outrance les ressources du continent. Et quand Dayak découvre que l\'homme qui dirige cet empire technologique n\'est autre que son propre frère, la lutte prend une dimension fascinante. Dayak possède l\'énergie et la force des meilleures sagas de S.F. et confirme le talent visionnaire du dessin d\'Adamov, qui signe là son premier scénario.    Adamov Philippe      Science-fiction 760 Arts graphiques - graphisme Dayak.  Glénat ','   1 ghetto 9   dans afrique futuriste consortium exploite outrance ressources continent quand dayak decouvre que homme qui dirige cet empire technologique n est autre que son propre frere lutte prend dimension fascinante dayak possede energie force meilleures sagas s f confirme talent visionnaire dessin adamov qui signe son premier scenario     adamov philippe science fiction 760 arts graphiques graphisme dayak  glenat ');
INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (9,1,' 3  3 Zaks    Une fois la ville-mère détruite, implosée, Dayak a réussi à échapper aux intercepteurs.En compagnie de son fidèle P\'tit Caille, le voilà au coeur du désert, prêt à se fondre dans cet univers inhospitalier, mais toujours suivi, à quelque distance, par son frère Simon, plus que jamais décidé à le rattraper. Or le Grand Désert est aussi le domaine des Zaks, les hommes-masques aux yeux sanguins. N\'est-ce qu\'un peuple de légende, où sont-ils vraiment là, cachés dans un dédale de galeries souterraines labyrinthiques ?Dayak ne tardera pas à être fixé . Bientôt résonneront les tambours des traditions humaines les plus anciennes, et les ombres démesurées des silhouettes primitives viendront s\'allonger auprès de lui.Grâce à leur intervention, Dayak parviendra à triompher définitivement de son frère, si tant est que la mort, pour les gens de son espèce, soit vraiment une fin...Alors, qui sont au juste ces Zaks qui s\'expriment en ces lieux désertiques ?Et si Dayak, d\'une certaine façon, finissait par devenir l\'un des leurs ?...    Adamov Philippe      Science-fiction 760 Arts graphiques - graphisme Dayak.  Glénat ','   3 zaks   fois ville mere detruite implosee dayak reussi echapper intercepteurs compagnie son fidele p tit caille voila coeur desert pret se fondre dans cet univers inhospitalier mais toujours suivi quelque distance par son frere simon plus que jamais decide rattraper or grand desert est aussi domaine zaks hommes masques yeux sanguins n est ce qu peuple legende ou sont ils vraiment caches dans dedale galeries souterraines labyrinthiques dayak ne tardera pas etre fixe bientot resonneront tambours traditions humaines plus anciennes ombres demesurees silhouettes primitives viendront s allonger aupres lui grace leur intervention dayak parviendra triompher definitivement son frere si tant est que mort pour gens son espece soit vraiment fin alors qui sont juste ces zaks qui s expriment ces lieux desertiques si dayak certaine facon finissait par devenir leurs     adamov philippe science fiction 760 arts graphiques graphisme dayak  glenat ');
INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (10,1,' 2  2 La chambre verte    La nouvelle Addis Abeba est née !Fini le ghetto, sa misère et sa crasse... Simon Colbius, leader de la C.P.M., a fait surgir une mégalopole où les techniques les plus sophistiquées côtoient les traditions les plus anciennes.Un monde où P\'tit Caille est devenu le valet de chambre du nouveau despote et Cori une courtisane que le nouveau comportement de Dayak trouble à peine.Car Dayak sait maintenant qu\'il est le frère de Simon, il a retrouvé dans de lointains souvenirs la vision fugace de cette Chambre verte où, enfants, ils percevaient les formidables changements que leur père orchestrait.Devenu le clone de Simon, Dayak parviendra-t-il à briser les chaînes qui le relient à ce frère qui se rêve maître de l\'Afrique et empereur d\'un nouvel âge ?    Adamov Philippe      Science-fiction 760 Arts graphiques - graphisme Dayak.  Glénat ','   2 chambre verte   nouvelle addis abeba est nee fini ghetto sa misere sa crasse simon colbius leader c p m fait surgir megalopole ou techniques plus sophistiquees cotoient traditions plus anciennes monde ou p tit caille est devenu valet chambre nouveau despote cori courtisane que nouveau comportement dayak trouble peine car dayak sait maintenant qu il est frere simon il retrouve dans lointains souvenirs vision fugace cette chambre verte ou enfants ils percevaient formidables changements que leur pere orchestrait devenu clone simon dayak parviendra il briser chaines qui relient ce frere qui se reve maitre afrique empereur nouvel age     adamov philippe science fiction 760 arts graphiques graphisme dayak  glenat ');
INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (11,1,'    Le chirurgien hollandais    Ile de Java, région de Semarang en 1897. Un décor exotique pour une aventure riche en rebondissements. Ironie et drame se conjugent pour ce premier tome d\'une nouvelle série qui confirme le talent de Christian Lamquet.\r\nUn chirurgien hollandais a découvert un crâne qu\'il cherche à faire authentifier comme l\'un des chaînons manquant de l\'histoire de l\'homme. Autour de lui, des personnages haut en couleurs : savants baroques, veuve éplorée, la guenon Lucy, un journaliste zélé, une femme qui ne rêve que de maternité. Et enfin : Pete, le crâne, lui-même personnage central de ce récit utilisant habilement théosophie, un mélange d\'occultisme et de spiritisme, et anthropologie.\r\nParce qu\'il est convaincu d\'avoir mis à jour des fossiles du fameux \"chaînon manquant\", Jacob Boos, un chirurgien hollandais en garnison à Semarang, est bien décidé à remuer ciel, terre, océan et bonne conscience pour prouver au monde la réalité de sa découverte...\r\n\" Pete \" comme il le surnomme affectueusement, était-il vraiment ce petit \"homme-singe debout\" parcourant la savane voici deux millions d\'années ?\r\nPour l\'heure, ce qu\'il a laissé de lui sommeille dans une valise : quelques bouts de vertèbres, un crâne, un morceau de mâchoire. Si Jacob y investit tous ses espoirs, d\'autres vont y engluer les précieuses reliques dans les délires de leurs utopies, de leurs passions ou de leur bêtises...\r\n Et puis tous ces malheurs qui se succèdent...\r\nPete, du fond de sa valise, porterait-il la poisse ?     bande dessinée Lamquet Chris      Bande dessinée 760 Arts graphiques - graphisme Glénat ','   chirurgien hollandais   ile java region semarang 1897 decor exotique pour aventure riche rebondissements ironie drame se conjugent pour ce premier tome nouvelle serie qui confirme talent christian lamquet chirurgien hollandais decouvert crane qu il cherche faire authentifier comme chainons manquant histoire homme autour lui personnages haut couleurs savants baroques veuve eploree guenon lucy journaliste zele femme qui ne reve que maternite enfin pete crane lui meme personnage central ce recit utilisant habilement theosophie melange occultisme spiritisme anthropologie parce qu il est convaincu avoir mis jour fossiles fameux chainon manquant jacob boos chirurgien hollandais garnison semarang est bien decide remuer ciel terre ocean bonne conscience pour prouver monde realite sa decouverte pete comme il surnomme affectueusement etait il vraiment ce petit homme singe debout parcourant savane voici deux millions annees pour heure ce qu il laisse lui sommeille dans valise quelques bouts vertebres crane morceau machoire si jacob y investit tous ses espoirs autres vont y engluer precieuses reliques dans delires leurs utopies leurs passions ou leur betises puis tous ces malheurs qui se succedent pete fond sa valise porterait il poisse     bande dessinee  lamquet chris bande dessinee 760 arts graphiques graphisme glenat ');
INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (12,1,'    La Chrysalide Diaprée    Pour sauver son grand-père qui se meurt, Benjamin doit ramener le Mangecoeur, un papillon funeste, avant l\'aube. Poursuivi par des clowns cruels dans une fête foraine où seuls les adultes sont admis, il rencontre Rififi, seul allié dans sa fuite. Mais cet ami et son compagnon Pantagas utilisent Benjamin à des fins peu louables... Le rêve et la magie règnent en maîtres dans ce conte merveilleux peuplé de clowns dangereusement malicieux. Le trait brillant de Jean-Baptiste Andréae s\'associe au scénario plus qu\'efficace de Mathieu Gallié.     bande dessinée Andréaé Jean-Baptiste      Gallié Mathieu      Bande dessinée Vents d\'Ouest ','   chrysalide diapree   pour sauver son grand pere qui se meurt benjamin doit ramener mangecoeur papillon funeste avant aube poursuivi par clowns cruels dans fete foraine ou seuls adultes sont admis il rencontre rififi seul allie dans sa fuite mais cet ami son compagnon pantagas utilisent benjamin fins peu louables reve magie regnent maitres dans ce conte merveilleux peuple clowns dangereusement malicieux trait brillant jean baptiste andreae s associe scenario plus qu efficace mathieu gallie     bande dessinee  andreae jean baptiste gallie mathieu bande dessinee vents d ouest ');
