INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (15,1,'    La métamorphose des fleurs    Avec Microcosmos, des milliers de lecteurs se sont émerveillés devant les prodiges insoupçonnés d\'un petit carré d\'herbes folles. Dans la Métamorphose des Fleurs, Claude Nuridsany et Marie Pérennou sillonnent prairies et jardins et invitent nos yeux inattentifs à se poser sur un bouton gorgé de sève, un pétale qui s\'entrouvre ou la chute d\'une corolle. Autant de moments phares de la vie flamboyante d\'une fleur, architecture de rêve construite et défaite en quelques jours. Transfigurées par la magie de la macrophotographie, une vingtaine d\'espèces florales naissent, vivent et meurent sous nos yeux. Marie Pérennou et Claude Nuridsany ont inventé, pour notre plus grand plaisir, un nouveau regard sur la nature, à mi-chemin entre la biologie et la poésie.   fleur;pistil;étamine;macrophotographie Pérennou Marie      Nuridsany Claude      Fleurs 580 Botanique - (les plantes) La Martinière ','   metamorphose fleurs   avec microcosmos milliers lecteurs se sont emerveilles devant prodiges insoupconnes petit carre herbes folles dans metamorphose fleurs claude nuridsany marie perennou sillonnent prairies jardins invitent nos yeux inattentifs se poser sur bouton gorge seve petale qui s entrouvre ou chute corolle autant moments phares vie flamboyante fleur architecture reve construite defaite quelques jours transfigurees par magie macrophotographie vingtaine especes florales naissent vivent meurent sous nos yeux marie perennou claude nuridsany ont invente pour notre plus grand plaisir nouveau regard sur nature mi chemin entre biologie poesie     fleur pistil etamine macrophotographie  perennou marie nuridsany claude fleurs 580 botanique plantes la martiniere ');
