INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (17,1,'    Carte routière : Ardèche - Haute-Loire, N° 11331   Carte routière et touristique   Présentation de l\'éditeur\r\nLa nouvelle génération des cartes routières Michelin ! Toutes les informations pour découvrir, sur une seule carte, un, deux ou trois départements de France et se repérer facilement en voiture.\r\n\r\nDe nombreuses nouveautés ont été intégrées à la carte « LOCAL » :\r\n- une carte plus lisible grâce à une échelle agrandie : 1/150 000e ou 1/175 000e\r\n- un index complet des localités pour accéder rapidement à l\'information\r\n- des plans de ville pour circuler dans les grandes agglomérations\r\n- une légende en image pour bien comprendre les symboles de la carte\r\n- une carte des terroirs\r\nUne nouvelle collection de cartes centrées sur le \"LOCAL\" pour vivre la route autrement !\r\npixel bas-vivarais;boutières;brisadois;cévennes;haut-vivarais;margeriche;velay Editions Michelin       Pays de la Loire 910 Géographie - voyages Michelin ','   carte routiere ardeche haute loire n 11331 carte routiere touristique     presentation editeur nouvelle generation cartes routieres michelin toutes informations pour decouvrir sur seule carte deux ou trois departements france se reperer facilement voiture nombreuses nouveautes ont ete integrees carte local carte plus lisible grace echelle agrandie 1 150 000e ou 1 175 000e index complet localites pour acceder rapidement information plans ville pour circuler dans grandes agglomerations legende image pour bien comprendre symboles carte carte terroirs nouvelle collection cartes centrees sur local pour vivre route autrement pixel   bas vivarais boutieres brisadois cevennes haut vivarais margeriche velay  editions michelin pays loire 910 geographie voyages michelin ');
