INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (42,1,'    Charte du XIIIe siècle, par laquelle Guillaume de Rezay de la paroisse de Ceaux (Maine et Loire) vend à Messire de Vernée, chevalier, sept sous et six deniers de rente.   Acte passé en la cour d\'Angers le jeudi avant la Saint Urbain l\'an mille deux cent quatre vingt dix neuf.  excellent état de conservation date en vieux style (V.ST.) - M. DU POUGET, archiviste-paléographe de l\'Indre, a bien voulu attirer mon attention sur le fait que cette charte était datée du joedi devant la Saint Alban (Saint Aubin d\'Angers, qui se fête le 1er mars - Pâques tombant en 1299 le 19 avril, il y a effectivement bien lieu de considérer que cette charte est du 25 février 1300, nouveau style (N.ST.) charte;rente;archive;Ceaux;paroisse;cens;Angers;Maine-et-Loire Rezay Guillaume de      Pays de la Loire 940 Histoire de l\'Europe ','   charte xiiie siecle par laquelle guillaume rezay paroisse ceaux maine loire vend messire vernee chevalier sept sous six deniers rente acte passe cour angers jeudi avant saint urbain an mille deux cent quatre vingt dix neuf    excellent etat conservation   date vieux style v st m pouget archiviste paleographe indre bien voulu attirer mon attention sur fait que cette charte etait datee joedi devant saint alban saint aubin angers qui se fete 1er mars paques tombant 1299 19 avril il y effectivement bien lieu considerer que cette charte est 25 fevrier 1300 nouveau style n st   charte rente archive ceaux paroisse cens angers maine loire  rezay guillaume de pays loire 940 histoire europe ');
