INSERT INTO `notices_global_index` (`num_notice`, `no_index`, `infos_global`, `index_infos_global`) VALUES (46,1,'    L\'adagio d\'Albinoni    Canon de Pachelbel, Jésus que ma joie demeure de J.S. Bach, Andante pour mandoline de Vivaldi, Menuet de Mozart, Menuet de Boccherini  On connaît mal ce compositeur vénitien exactement contemporain de Vivaldi, mais une seule œuvre, pourtant, a assuré sa notoriété, l’Adagio pour cordes, extrait en fait du Concerto en ré majeur. Cette longue cantilène plaintive a servi au film Quatre mariages et un enterrement.  Marion Alain      Bride Philip      780 Musique Forlane ','   adagio albinoni   canon pachelbel jesus que ma joie demeure j s bach andante pour mandoline vivaldi menuet mozart menuet boccherini    on connait mal ce compositeur venitien exactement contemporain vivaldi mais seule uvre pourtant assure sa notoriete adagio pour cordes extrait fait concerto re majeur cette longue cantilene plaintive servi film quatre mariages enterrement   marion alain bride philip 780 musique forlane ');
